<script>
export default {
  name: "backgroundBlog",
  methods: {
    animateLayersOnScroll() {
      window.addEventListener("scroll", () => {
        let layer2 = document.getElementsByClassName("layer-blog-2")[0];
        let layer3 = document.getElementsByClassName("layer-article-3")[0];
        let layer4 = document.getElementsByClassName("layer-article-4")[0];
